import React from 'react';
import "../App.css"

class Influencer extends React.Component {

    componentDidMount(){
        console.log(this.props.user.picture)
    }

render(){

    let style = {
    background:`${this.props.user.picture}`
    }


    return (
        <div className="demo-card-wide mdl-card mdl-shadow--2dp">
            <div className="mdl-card__title avatar" >
                <h2 className="mdl-card__title-text" style = {style}>Welcome !</h2>
            </div>
            <div className="mdl-card__supporting-text">
                View your orders, share-revenue and more...
            </div>
            <div className="mdl-card__actions mdl-card--border">
                <a className="mdl-button mdl-button--colored mdl-js-button mdl-js-ripple-effect">
                Sign Out
                </a>
            </div>            
        </div>
    )
}
}

 export default Influencer;
